description:
Wes Craven Presents Dracula II: Ascension (2003)



Verenigde Staten
Horror
90 minuten

geregisseerd door Patrick Lussier
met Jason Scott Lee, Jason London en Craig Sheffer

De sequel op 'Dracula 2000'. Enkele studenten in de medicijnen besluiten een 'dode' vampier mee te nemen die ze in het mortuarium van de stad gevonden hebben. Ze trachten een stof te maken uit zijn bloed dat alles geneest en met vele miljoenen in het vooruitzicht als het ze lukt.


English

NOTE: Sequel to Dracula 2000 . It is not crucial, but it helps to have first seen Dracula 2000 ...

